import {Component} from 'react';
import {Navbar, Nav, NavDropdown, Container} from 'react-bootstrap'
import NagdaaLogo from '../public/media/logoNagda.svg';
import LogoRectengle from '../public/media/logoRectengle.svg';
import {connect} from 'react-redux'
import IniStateModel from '../models/redux.state.ini';
import Link from "next/link";

class AppNavBar extends Component {

    static getInitialProps({store, ctx}) {

        /* return {
             state: {
                 ...IniStateModel
             }
         }*/

        return {}
    }


    componentDidMount() {
        console.log(this.props)
    }

    render() {
        return (
            <Navbar expand="lg" className="py-4">
                <Container>
                    <div className="">
                        <Navbar.Brand href="/home" className="d-flex flex-row">
                            <div className="position-relative">
                                <img src={LogoRectengle} className=""/>
                                <img src={NagdaaLogo} className='position-absolute nagaaLogo'/>
                            </div>
                            <h2 className="text-muted mt-4 mr-2 Cairo-bold">نجدة</h2>
                        </Navbar.Brand>
                    </div>

                    <Navbar.Toggle aria-controls="basic-navbar-nav" className=""/>
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto text-lg-right text-center">

                            <Link href="/home">
                                <a className={`${this.props.state.activeLink == 'home' ? 'active' : ""} nav-link`}>
                                    الرئيسية
                                </a>
                            </Link>

                            <Link href={'/web-app'}>
                                <a className="nav-link">تطبيق الويب</a>
                            </Link>

                            <Link href={'/mobile-app'}>
                                <a className="nav-link">تطبيق الهاتف</a>
                            </Link>


                            <Link href={'/who-we-are'}>

                                <a className={`${this.props.state.activeLink == 'contact us' ? 'active' : ""} nav-link`}>
                                    تواصل معنا
                                </a>

                            </Link>


                            <Link href={'/contact'}>
                                <a className={`${this.props.state.activeLink == 'who-we-are' ? 'active' : ""} nav-link`}>
                                    من نحن
                                </a>
                            </Link>

                            <Link href={'/faq'}>
                                <a className={`${this.props.state.activeLink == 'faq' ? 'active' : ""} nav-link`}>
                                    اسئلة مكرره
                                </a>
                            </Link>
                        </Nav>
                    </Navbar.Collapse>

                </Container>

            </Navbar>
        )
    }
}


const stateToProps = state => {
    return {
        ...state,
    }
};

export default connect(stateToProps)(AppNavBar);
